// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.5.16;
contract Refugee {
    // Register user
    struct User {
        string UserId;
        string fName;
        string lName;
        string dob;
        string mobileno;
        string nationality;
        uint256 age;  
    }
    // Variables - uint
    uint256 public noofUser = 0;
    uint256 public k=0;

    //mapping
    mapping (string  => address payable) public usersWithAddress;
    mapping (string  => User) public users;
    mapping (uint256 => string) public allUserId;

    //events
    event createduser(string UserId, string fName,string lName,string dob,string mobileno,string nationality,uint256 age);
    event createduse(string message);

    function chkexisitinguserId(string memory _userId) public view returns (bool) {
        bool isexist = false;
        for(uint a =0;a<k;a++){
            if(keccak256(abi.encodePacked(_userId)) == keccak256(abi.encodePacked(allUserId[a]))){
                isexist = true;
                break;
            }
        }
         return isexist;
    }

    // create a users 
    function createUser(string memory _userId, string memory _fName, string memory _lName, string memory _mobile, string memory _dob, string memory _nationality, uint256 _age) public {
        if(!chkexisitinguserId(_userId)){
            users[_userId] = User(_userId, _fName, _lName, _mobile, _dob, _nationality, _age);
            noofUser++;
            allUserId[k] = _userId;
            k++;
            emit createduser(_userId, _fName, _lName, _mobile, _dob, _nationality, _age);
        }else{
            emit createduse("else is working username already exist");
        }
    }
}
